INSERT INTO Series(id, title, overview, popularity, seasons, episodes, posterPath, voteCount, voteAvg, firstAir, lastAir, tagline) VALUES(105009,'Tokyo Revengers','Takemichi Hanagaki is a freelancer that\'s reached the absolute pits of despair in his life. He finds out that the only girlfriend he ever had, in middle school, Hinata Tachibana, had been killed by the ruthless Tokyo Manji Gang. The day after hearing about her death, he\'s standing on the station platform and ends up being pushed over onto the tracks by a herd of people. He closes his eyes thinking he\'s about to die, but when he opens his eyes back up, he somehow had gone back in time 12 years. Now that he\'s back living the best days of his life, Takemichi decides to get revenge on his life.',230.106,1,12,'/qSEKyf0fWhrCEQ3LTwLqe41eSvR.jpg',1, 8,'2021-04-11', '2021-04-11', '');
